    false,nt"url": null,nt"notes": "NODC Accession 0129837 includes physical,
    profile and underway data collected aboard the ROGER REVELLE during cruise RR1108
    in the Philippine Sea and South China Sea (Nan Hai) from 2011-06-10 to 2011-06-20.
    These data include CONDUCTIVITY, CURRENT SPEED - EAST/WEST COMPONENT (U), CURRENT
    SPEED - NORTH/SOUTH COMPONENT (V), SALINITY and WATER TEMPERATURE. The instruments
    used to collect these data include ADCP, CTD and GPS. These data were collected
    by Matthew Alford of University of Washington; Applied Physics Laboratory, and by
    University of California - San Diego; Scripps Institution of Oceanography as part
    of Internal Waves in Straits Experiment (IWISE). The Lamont-Doherty Earth Observatory
    (LDEO) submitted these data to NODC as part of the NSF sponsored Rolling Deck to
    Repository (R2R) program.nnThe ADCP data represent the raw and automated processed
    data set. Post processed quality assessed data are not available in this accession.",nt"license_title":
